import React from 'react';
import Carousel from 'react-material-ui-carousel';
import {Paper, Button} from '@material-ui/core';
import { projects } from '../../data';
import { styled } from '@material-ui/core/styles';

export const MyCar = styled(Carousel)({
    backgroundColor: "black"
});



const Pros = ({isOpen}) => {

    const card = (props) => {
    return (
        <Paper>
            <img src={"somthing"}/>
            <h2>{props.name}</h2>
            <p>{props.description}</p>
            <Button className="CheckButton">See website</Button>
            <Button className="CheckButton">See code</Button>
        </Paper>
    )}
    return(
        <>
        {isOpen ? 
        <div syle={{position: 'absolute', display: "flex", justifyContent: "center", height: "75vh"}}>
            <MyCar
            autoPlay={false}
            className="car"
            animation="slide"
            classes={{}}
                next={ (next, active) => console.log(`we left ${active}, and are now at ${next}`) }
                prev={ (prev, active) => console.log(`we left ${active}, and are now at ${prev}`) }
                >
                { projects.map(project => card(project))}
            </MyCar>
        </div>
        :
        null
    }
    </>
    )
}

export default Pros
